import React, { Component } from 'react'
import importedNames from "../names"

export class SearchBar extends Component {
  constructor(props) {
    super(props)

    this.state = {
      names: importedNames
    }
  }
  render() {
    return (
      <div>
        <h1>Name Search</h1>
        <form>
          <input
            type="text"
            defaultValue="search names..."
            >
          </input>
        </form>
        <div>We will render names here
          {this.state.names.map(
            <p>this.state.Name</p>
          )}
        </div>
      </div>
    )
  }
}

export default SearchBar
